import React from "react";
import { Link } from "react-router-dom"; // ‚úÖ ‡§Ø‡§π ‡§ö‡§æ‡§π‡§ø‡§è

const Sidebar = ({ sidebarOpen, setSidebarOpen, activeSection, setActiveSection }) => {
  return (
    <div
      className={`md:sticky md:top-28 fixed top-28 left-0 z-10 w-80 md:w-80 h-auto rounded-xl p-6 shadow-lg bg-[#111827] text-white transform ${
        sidebarOpen ? "translate-x-0" : "-translate-x-full"
      } transition-transform duration-300 md:translate-x-0`}
    >
      {/* Profile */}
      <div className="text-center mb-6">
        <img
          src="https://cdn.pixabay.com/photo/2015/10/05/22/37/blank-profile-picture-973460_960_720.png"
          className="w-24 h-24 rounded-full mx-auto border-4 border-white/60"
          alt="Profile"
        />
        <h2 className="text-xl font-semibold mt-3">John Doe</h2>
        <p className="text-white/80 text-sm">john.doe@example.com</p>
      </div>

      {/* Menu */}
      <div className="space-y-3">
        {/* Edit Profile Button */}
        <button
          className={`w-full text-left px-4 py-2 rounded-lg font-semibold ${
            activeSection === "editProfile" ? "bg-white/20" : "bg-white/10"
          } hover:bg-white/20`}
          onClick={() => setActiveSection("editProfile")}
        >
          ‚úèÔ∏è Edit Profile
        </button>

        {/* My Favorites Link */}
        <Link
          to="/my-ads"
          className={`w-full text-left px-4 py-2 hover:bg-white/20 rounded-lg block ${
            activeSection === "myFavorites" ? "bg-white/20" : ""
          }`}
          onClick={() => setActiveSection("myFavorites")}
        >
          ‚≠ê My Favorites
        </Link>

        {/* My Ads Button */}
        <Link
          to="/my-ads"
          className={`w-full text-left px-4 py-2 hover:bg-white/20 rounded-lg block ${
            activeSection === "myAds" ? "bg-white/20" : ""
          }`}
          onClick={() => setActiveSection("myAds")}
        >
          üì¢ My Ads
        </Link>

        {/* Manage Ads Button */}
        <button
          className={`w-full text-left px-4 py-2 hover:bg-white/20 rounded-lg ${
            activeSection === "manageAds" ? "bg-white/20" : ""
          }`}
          onClick={() => setActiveSection("manageAds")}
        >
          üõ† Manage Ads
        </button>

        {/* Payments Button */}
        <button
          className={`w-full text-left px-4 py-2 hover:bg-white/20 rounded-lg ${
            activeSection === "payments" ? "bg-white/20" : ""
          }`}
          onClick={() => setActiveSection("payments")}
        >
          üí≥ Payments
        </button>

        {/* Orders Button */}
        <button
          className={`w-full text-left px-4 py-2 hover:bg-white/20 rounded-lg ${
            activeSection === "orders" ? "bg-white/20" : ""
          }`}
          onClick={() => setActiveSection("orders")}
        >
          üì¶ Orders
        </button>

        {/* Safety Tips Button */}
        <button
          className={`w-full text-left px-4 py-2 hover:bg-white/20 rounded-lg ${
            activeSection === "safetyTips" ? "bg-white/20" : ""
          }`}
          onClick={() => setActiveSection("safetyTips")}
        >
          üîí Safety Tips
        </button>

        {/* Settings Button */}
        <button
          className={`w-full text-left px-4 py-2 hover:bg-white/20 rounded-lg ${
            activeSection === "settings" ? "bg-white/20" : ""
          }`}
          onClick={() => setActiveSection("settings")}
        >
          ‚öôÔ∏è Settings
        </button>

        {/* Logout Button */}
        <button className="w-full text-left px-4 py-2 text-red-500 hover:bg-red-200/10 rounded-lg">
          üö™ Logout
        </button>
      </div>

      <hr className="my-6 border-white/40" />

      {/* Search Box */}
      <div className="bg-[#111827] p-5 rounded-xl shadow-md text-white">
        <label className="font-semibold block mb-1">WHERE ARE YOU LOOKING FOR?</label>
        <input
          type="text"
          placeholder="Type your location..."
          className="w-full p-3 border rounded-lg focus:ring-2 focus:ring-blue-500 text-white bg-gray-900"
        />
        <label className="block font-semibold mt-4">All Categories</label>
        <select className="w-full p-3 border rounded-lg mt-1 bg-gray-900 text-white">
          <option>Select Category</option>
          <option>üè† Apartments</option>
          <option>üè° Villas</option>
          <option>üåÜ Office Spaces</option>
        </select>
        <button className="w-full mt-4 py-3 rounded-lg font-semibold text-white bg-gradient-to-r from-[#0B64BD] to-[#3FA1E6]">
          Search
        </button>
      </div>
    </div>
  );
};

export default Sidebar;
